THE PATENTS ACT, 1970 (Selected Sections)

Section 3. What are not inventions.
The following are not inventions within the meaning of this Act,-
(a) an invention which is frivolous or which claims anything obviously contrary to well established natural laws;
(b) an invention the primary or intended use or commercial exploitation of which could be contrary public order or morality or which causes serious prejudice to human, animal or plant life or health or to the environment;
(d) the mere discovery of a new form of a known substance which does not result in the enhancement of the known efficacy of that substance...
(h) a method of agriculture or horticulture;
(i) any process for the medicinal, surgical, curative, prophylactic, diagnostic, therapeutic or other treatment of human beings...

